import React, { Component } from 'react';
import './App.css';
import "bootstrap/dist/css/bootstrap.css";

class App extends Component {
  state = { 
    total: ""
  }

  render() { 
    return (
      <div>
        <div>
          Total: {this.state.total}
        </div>
        <div>
          <button type="button" class="btn m-3 btn-secondary">1</button>
          <button type="button" class="btn m-3 btn-secondary">2</button>
          <button type="button" class="btn m-3 btn-secondary">3</button>
        </div>
        <div>
          <button type="button" class="btn m-3 btn-secondary">4</button>
          <button type="button" class="btn m-3 btn-secondary">5</button>
          <button type="button" class="btn m-3 btn-secondary">6</button>
        </div>
        <div>
          <button type="button" class="btn m-3 btn-secondary">7</button>
          <button type="button" class="btn m-3 btn-secondary">8</button>
          <button type="button" class="btn m-3 btn-secondary">9</button>
        </div>
        <div>
          <button type="button" class="btn m-3 btn-secondary">0</button>
          <button type="button" class="btn m-3 btn-secondary">Restart</button>
        </div>
      </div>
     );
  }
}

export default App;
